import Logo from "../assets/images.png";
import "../styles/header.css";

   const Header = () => {
  return (
    <div>

    <header className="header">
    <img className="log" src={Logo} alt="QUIZ"/>
    <a href="/">Home</a>
    <div className="top">
    <p>Login</p>
    <p>Sign Up</p>
    <input class="search-bar" type="text" placeholder="search"/>
    </div>

    </header>

    </div>

  );
}

export default Header;
